function submitAnswer(a){a=$(".submit-answer").val(),checkAnswer(a)}function checkAnswer(a){var b=hex_sha1(a),c=UtilManager.data.tpl[b];c?($(".main-region").html(c),$(".submit-answer").val("")):alert("这不是一份有效的行动哦")}var UtilManager=new Marionette.Application;!function(a){Swag.registerHelpers(Handlebars),a.addRegions({bannerRegion:"#banner-region",mainRegion:"#main-region"})}(UtilManager),UtilManager.data={},UtilManager.data.tpl={e540cdd1328b2b21e29a95405c301b9313b7c346:["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>1 南瓜机横行</h2>","<h3>The Nanguaji Walks</h3>","<p>你被困住了。</p>","<p>当你又一次打开南瓜机的时候，你的眼前闪过一道奇异的光芒。</p>","<p>然后你发现你身处一个未知的空间。</p>","<p>你心中闪过不祥的阴霾、惊恐，还有一丝的兴奋。你的脑中传来一个陌生而深沉的声音。</p>","<p>想走出去吗？看看右上角，在那里输入<kbd>南瓜机</kbd>，你就能进入下一个空间。</p>","<p>前面的路还很长。</p>","<small>提示：做笔记是一个好习惯。</small>"],d5207cf8319a41e2aecca200f69fbe472185f006:["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>2 好人</h2>","<h3>A Good Guy</h3>","<p>在这片空间中你只看见了一个人。</p>","<p>好人说，他是好人。</p>","<p>好人说，因为他是好人，他决定告诉你这里的答案。</p>","<p>好人说，这片空间的答案是<kbd>aB3四</kbd>。</p>","<small>提示：全程注意你的中英文输入法、大小写锁定和全角半角。</small>"],"8c8eb677fd7bf43f45b8381cfe2570500952ed8a":["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>3 刨冰</h2>","<h3>Water-ice</h3>","<p>你希望只回答一个简单的问题就通过这里。</p>","<p>刨冰同意了。</p>","<p>于是刨冰问你：“这里是第几关？”</p>"],"77de68daecd823babbb58edb1c8e14d7106e83bb":["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>4 汀兰</h2>","<h3>Tinglan</h3>","<p>“答案是<kbd>123</kbd>”，Tinglan告诉你。</p>","<p>你试了试，却没有如愿以偿。</p>","<p>“这里本来就是一片颠倒的空间嘛，嘻嘻”，Tinglan继续说。</p>"],"5f6955d227a320c7f1f6c7da2a6d96a851a8118f":["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>5 浙大名人小伯爵</h2>","<h3>Little Earl The Celibrity of ZJU</h3>","<p>小伯爵快速翻阅着火凤燎原版杀规则。</p>","<p>小伯爵翻到了第1页：【任才翱翔】。</p>","<p>小伯爵继续读第1页：【琳琅妙笔】。</p>","<p>小伯爵翻到了第2页：【养兵千日】。</p>","<p>小伯爵翻到了第3页：【皇族毒宴】。</p>","<p>小伯爵翻到了第5页：【无双剑围】。</p>","<p>小伯爵接下来翻到了第几页？</p>"],fe5dbbcea5ce7e2988b8c69bcfdfde8904aabc1f:["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>6 落英环林</h2>","<h3>Falling Flowers Around The Forest</h3>","<p>你来到了木木的课堂上，木木向你出示了一组数字。</p>","<p>92, 98, 86, 110, 62, ...</p>"],a3d12597f93e80f7f6a229cebb1c3e10d4f34ec3:["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>7 且霭停云</h2>","<h3>The Stopped Cloud</h3>","<p>欢迎与停云抱团。</p>","<p>你进团的时候依次特殊指认了赵云-马良-曹仁。</p>","<p>你确实这么做了，没有骗你。</p>","<p>如果你想离开，你需要指认荀彧-蔡琰-吕布。</p>"],"5e135004678c6647104ce1c04ae0027fc897f303":["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>8 大卫正在整理武将</h2>","<h3>David Is Playing Bubble</h3>","<p>大卫统计了一下三国版杀蜀国一命的角色的技能数量。</p>","<p>刘备：【桃园结义】【三顾茅庐】【痛哭流涕】【马跃檀溪】【承道受业】【乱世枭雄】【五虎封将】。</p>","<p>徐庶：【击剑长歌】【玄门破阵】【披发涂炭】。</p>","<p>庞统：【连环妙计】【运筹帷幄】。</p>","<p>关羽：【英雄相惜】【春秋大义】【过关斩将】【水淹七军】【单刀赴会】。</p>","<p>张飞：【探阵斩将】【临桥虎吼】。</p>","<p>赵云：【单枪救主】【浑身是胆】【绝处逢生】。</p>","<p>糜氏：【相夫教子】【深明大义】【视死如归】。</p>","<p>他按顺序读了一遍“刘备 徐庶 庞统 关羽 张飞 赵云 糜氏”这个序列，并对于遇到的相邻两个技能数量不同的角色，将技能少的角色交换到了前面。</p>","<p>然后他重复了若干遍直到他觉得没意思了，最后序列变成了“庞统 张飞 徐庶 赵云 糜氏 关羽 刘备”。</p>","<p>大卫满意地在旁边写下了：12。</p>","<p>然后大卫递给你一张纸，上面写着：</p>","<p>曹操：【割发代首】【割须弃袍】【亲冒矢石】【青梅煮酒】【铜雀春深】【分道扬镳】【血战官渡】。</p>","<p>郭嘉：【洞若观火】【料事如神】【奉孝安在】。</p>","<p>贾诩：【计赚徐庶】【虚虚实实】【韬光养晦】【料敌机先】。</p>","<p>夏侯惇：【拔矢啖睛】【曹氏宗亲】。</p>","<p>夏侯渊：【曹氏宗亲】【三日五百】【六日一千】【虎步关右】。</p>","<p>张辽：【英雄相惜】【威震逍遥津】【乱箭齐发】。</p>","<p>典韦：【挺身护驾】【宛城血战】【古之恶来】。</p>","<p>蔡琰：【文姬归汉】【名门闺秀】【悲愤诗】【胡笳十八拍】。</p>"],fa35e192121eabf3dabf9f5ea6abdbcbc107ac3b:["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>9 集智的车轱辘</h2>","<h3>Meow's CGL</h3>","<p>集智养了许多妹子，她让车轱辘给妹子们安家。</p>","<p>但是车轱辘没有足够的卡槽，很多妹子只能挤在一个卡槽里。</p>","<p>举个例子，假如有23个妹子，车轱辘建立了3个卡槽，为了保证公平，剩下2个妹子就没有地方安家了。</p>","<p>集智生气了，让车轱辘重新建立卡槽。这回车轱辘重新建立了5个卡槽，但是仍然有3个妹子没有地方去，然后车轱辘又重新建立了7个卡槽，但是还有2个妹子没有地方去。</p>","<p>车轱辘在日记里把这项糟糕的工作记录为：</p>","<p>3 2</p>","<p>5 3</p>","<p>7 2</p>","<p>你对这项工作顿时产生了兴趣，于是集智和车轱辘表示如果你愿意帮助他们建立卡槽，就让你通过。</p>","<p>第二天，新来了一批妹子交给你负责。</p>","<p>你的工作记录是这样写的：</p>","<p>5 2</p>","<p>6 4</p>","<p>7 4</p>","<p>正当你打算离开的时候，集智忽然问你。</p>","<p>“今天至少来了多少个妹子？”</p>"],c1aa04bf421e5b38c3d18933e9994d3f289def65:["<h1 class='huawenxingkai'>序章 渐进崩坏的前奏</h1>","<h3>Prologue: The Prelude of The Progressive Collapse</h3>","<h2 class='huawenxingkai'>10 战车</h2>","<h3>The Chariot</h3>","<p>这里充斥着火焰，只有一条狭窄的通道。</p>","<p>通道的尽头是一扇打开门扉，从中逸散出奇异的能量。</p>","<p>突然一辆战车从天而降。</p>","<p>战车没有向你发动袭击，似乎它只是为了阻挡你的前进而出现的。</p>","<p>你仔细观察这战车，最上面雕刻着一个南瓜形状的图案。</p>","<p>下面写着：“aB3四”。</p>","<p>再向下看，你注意到了一个六位数字的密码锁。</p>","<p>密码锁的下方写着：“一生二，二生三，三生……”。</p>"],b4709682f352b52030c1b80fb6a988fcf41bb7e8:["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>11 洛潮</h2>","<h3>Tide of Los Water</h3>","<p>洛洛见到你，似乎显得有些慌张。</p>","<p>“答案是816”，洛洛小声说道。</p><br/><br/><br/><br/>","<p style='color:#fff;'>“其实答案是qinyangsong7”，洛洛心里想着。</p>"],"9786fc59f02073b2bd5cfc3d433e09d982f0adcf":["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>12 人格很好</h2>","<h3>Excellent Personality</h3>","<p>“爱人如己。”</p>","<p>“遵守诫命。”</p>","<p>“以宽广的胸怀待人。”</p>","<img src='resources/img/jesus.png'></img>"],"41ee552a6ba4259de7d7d5e49aaa38fcb76971a0":["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>13 舒璃</h2>","<h3>Shuli</h3>","<p>“我这里有一幅狂放的画，你看过吗？”</p>","<img src='resources/img/sf.jpg'></img>"],c7a8dba8d65001dbb9b86521c368fc9431ca517d:["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>14 木木蓝颜</h2>","<h3>Mumu The Blue Face</h3>","<p>木木在你面前一闪而过，只留下一串残影。</p>","<p>追上她的速度吧。</p>","<img src='resources/img/fast.gif'></img>"],"72e0d6b8b81a6f338fccc55bfd51bd064e52ee83":["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>15 巷陌</h2>","<h3>Savvy Alley</h3>","<p>“我给你的数字是<kbd>16465437</kbd>。”</p>","<p>“哦这只是一个数字，并不是过关的答案啦。”</p>","<p>“给你一个提示吧，数字中某些方面的上限，再加上你接下来要去的那个地方。”</p>"],"3088301a8865e6fb972cc89615a5ad1e42124786":["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>16 南柯同学</h2>","<h3>Student Nanke</h3>","<p>“揭示真相吧，钥匙就是你过来时候的那把钥匙。”</p>","<img src='resources/img/nanke.png'></img>"],"717c4ecc723910edc13dd2491b0fae91442619da":["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>17 abcblk</h2>","<h3>ABCBLK</h3>","<p>“猜猜我心中的那个英文单词。”</p>","<img src='resources/img/abc.png'></img>"],d42c0112962be8a77d278ebe747514e509c4a5fa:["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>18 殷寂言</h2>","<h3>Yin Jiyan</h3>","<p>寂言是版杀圈知名娱乐活动“版杀技能你画我猜”的主持人。</p>","<p>现在她想告诉你什么技能呢？</p>","<img src='resources/img/jiyan.png'></img>"],c19b6c1a5e4a91d57e16688fdb474689594a0d97:["<h1 class='huawenxingkai'>第一章 原初形象的法则</h1>","<h3>Chapter I: The Principle of The Original Image</h3>","<h2 class='huawenxingkai'>19 1133wcl</h2>","<h3>1133wcl</h3>"]},checkAnswer("index");